style.css:
@-moz-document url-prefix("https://forum.arizona-rp.com") {
body, html {
        background-color: #121212 !important;
        color: #ffffff !important;
    }

    .wrapper {
        background-color: #1e1e1e !important;
        color: #ffffff !important;
    }

    .pageContent, .pageWidth {
        background-color: #1e1e1e !important;
        color: #ffffff !important;
    }

    h1, h2, h3, h4, h5, h6, a {
        color: #ffffff !important;
    }

    .navTabs {
        background-color: #333333 !important;
        border-bottom: 1px solid #444444 !important;
    }

    .navTabs .navTab a {
        color: #ffffff !important;
    }

    .navTabs .navTab:hover {
        background-color: #444444 !important;
    }

    /* Секции и блоки */
    .sectionMain, .sectionFooter, .messageList {
        background-color: #1e1e1e !important;
        border: 1px solid #333333 !important;
    }

    .sectionMain .secondaryContent, .sectionFooter .secondaryContent, .messageList .secondaryContent {
        background-color: #2e2e2e !important;
    }

    /* Сообщения и посты */
    .messageContent, .messageText {
        background-color: #2e2e2e !important;
        color: #ffffff !important;
    }

    .messageUserBlock {
        background-color: #333333 !important;
        border-right: 1px solid #444444 !important;
    }

    .message .signature {
        border-top: 1px solid #444444 !important;
    }

    textarea, input[type="text"], input[type="password"], input[type="email"], input[type="search"] {
        background-color: #2e2e2e !important;
        border: 1px solid #444444 !important;
        color: #ffffff !important;
    }

    button, .button {
        background-color: #bb86fc !important;
        border: none !important;
        color: #121212 !important;
    }

    a {
        color: #bb86fc !important;
    }

    a:hover, .button:hover, .navTabs .navTab:hover a {
        color: #ffffff !important;
        background-color: #bb86fc !important;
    }

    .footer {
        background-color: #1e1e1e !important;
        color: #ffffff !important;
    }
}
